import flet as ft
import content as co
import warenkorb as wk

_products = None

_ent = [12.5,23,5.2,40,12.5,23,5.2,40]

_bau = ["Rosa", "Meier", "Franz", "KuhHof"]

def getProducts():
    global _products
    if _products is None:
        _products = [
            product(1, "Bio-Gemüse", "Frisch geerntetes Bio-Gemüse von lokane Bauern.", 2.50, "kg", 1, "Gemüse"),
            product(2, "Bio-Obst", "Frisch geerntetes Bio-Obst von lokane Bauern.", 1.50, "kg", 2, "Obst"),
            product(3, "Fleisch", "Fleisch von frei gehalteden Tieren.", 12.00, "kg", 3, "Fleisch"),
            product(4, "Eier", "Eier von feiland Hühnern.", 10, "Stück", 4, "Eier"),
            product(1, "Bio-Gemüse", "Frisch geerntetes Bio-Gemüse von lokane Bauern.", 2.50, "kg", 1, "Gemüse"),
            product(2, "Bio-Obst", "Frisch geerntetes Bio-Obst von lokane Bauern.", 1.50, "kg", 2, "Obst"),
            product(3, "Fleisch", "Fleisch von frei gehalteden Tieren.", 12.00, "kg", 3, "Fleisch"),
            product(4, "Eier", "Eier von feiland Hühnern.", 10, "Stück", 4, "Eier")
        ]

    for i in _products:
        i.proImg = ""  
    
    return _products

class product():
    def __init__(self, proId, name, beschreibung, preis, einheit, bauId, proArt, img=None):
        self.proId = proId
        self.name = name
        self.beschreibung = beschreibung
        self.preis = preis
        self.einheit = einheit
        self.bauId = bauId
        self.proArt = proArt
        self.proImg = img
        self.ope = False

    def opePro(self):
        for p in getProducts():
            p.ope = False
        self.ope = True

    def cloPro(self):
        self.ope = False

def proSite(prod, site):
    def back_click(e):
        prod.cloPro()
        co.updatePage(site)
    
    def add_to_cart_click(e):
        wk.addToWarenkorb(prod, menge=1)
        site.page.snack_bar = ft.SnackBar(
            content=ft.Text(f"{prod.name} zum Warenkorb hinzugefügt"),
            bgcolor="#90C040"
        )
        site.page.snack_bar.open = True
        site.page.update()

    header = ft.Row(controls=[
        ft.IconButton(icon=ft.Icons.ARROW_BACK, on_click=back_click),
        ft.Text("Produkte")
    ])

    img = ft.Image(
        src_base64=prod.proImg,
        width=200,
        height=200
    )

    body = ft.Column(controls=[
        img,
        ft.Text(prod.name, theme_style=ft.TextThemeStyle.HEADLINE_LARGE),
        ft.Text(prod.beschreibung),
        ft.Row(),
        ft.Text("Preis"),
        ft.Text(f"{prod.preis} € / {prod.einheit}"),
        ft.Row(),
    ],
    horizontal_alignment=ft.CrossAxisAlignment.CENTER)

    footer = ft.Row(controls=[
        ft.Button("In den Warenkorb", on_click=add_to_cart_click),
    ],
    alignment=ft.MainAxisAlignment.CENTER)

    re = ft.Column(controls=[
        ft.Row(),
        header,
        ft.Divider(),
        body,
        ft.Divider(),
        footer,
        ft.Divider()
    ],
    scroll=ft.ScrollMode.AUTO)

    return re

def bacCli(e, site):
    site.seaSta.mode = None
    site.seaSta.seaTex = ""
    site.seaSta.seaEna = False
    co.updatePage(site)

def cliPro(site, pro):
    pro.opePro()
    co.updatePage(site)

def proSeaRes(products, site):
    seaTer = site.seaSta.seaTex.lower().strip()
    
    if seaTer:
        filPro = [pro for pro in products if seaTer in pro.name.lower() or seaTer in pro.proArt.lower()]
    else:
        filPro = products
    
    header = ft.Row(
        controls=[
            ft.IconButton(icon=ft.Icons.ARROW_BACK, on_click=lambda e: bacCli(e, site)),
            ft.Text(f"Suchergebnisse ({len(filPro)} gefunden)", 
                theme_style=ft.TextThemeStyle.BODY_MEDIUM)
        ]
    )
    
    if len(filPro) == 0:
        return ft.Column(
            controls=[
                ft.Row(),
                header,
                ft.Divider(),
                ft.Text("Keine Produkte gefunden.", size=16, color=ft.Colors.GREY_700)
            ],
            horizontal_alignment=ft.CrossAxisAlignment.CENTER
        )
    
    proCar = []
    for prod in filPro:        
        card = ft.Card(
            content=ft.Container(
                content=ft.Column(controls=[
                    ft.Text(_bau[prod.bauId-1], size=12),
                    ft.Text(prod.name, weight=ft.FontWeight.BOLD, size=14),
                    ft.Text(prod.proArt, color=ft.Colors.GREY_700, size=12),
                    ft.Text(f"{prod.preis} € / {prod.einheit}", size=14),
                    ft.Text(f"{_ent[prod.proId-1]} km entfernt", size=12)
                ]),
                padding=15,
                on_click=lambda e: cliPro(site, prod)
            ),
            width=0.4 * site.page.width,
            height=0.25 * site.page.height,
        )
        proCar.append(card)
    
    body = ft.Row(
        wrap=True,
        controls=proCar,
        spacing=10,
    )
    
    return ft.Column(
        controls=[
            ft.Row(),
            header,
            ft.Divider(),
            body
        ],
        spacing=20,
        scroll=ft.ScrollMode.ALWAYS
    )

def shoPro(site):
    products = getProducts()
    openProd = False
    prod = None

    for i in products:
        if i.ope:
            openProd = True
            prod = i
            break

    if openProd:
        return proSite(prod, site)
    else:
        return proSeaRes(products, site)